import React from 'react';



class Nav  extends React.Component {


    render() { 
        return ( 
<div>

<input id="burger" type="checkbox" />

<label for="burger">
    <span></span>
    <span></span>
    <span></span>
</label>

<nav>    
  <ul>
    <li><a href="#">Home</a></li>
    <li><a href="#">About</a></li>
    <li><a href="#">Galle</a></li>
  </ul>  
</nav>
        </div>
        );
    }
}
export default Nav ;
